const InputFile = ({id, label, ...props}) =>{
    return(
        <>
        <label htmlFor={id}>{label}</label>
           <input id={id} {...props}
             {...register("firstname", { required: true })}
             aria-invalid={errors.firstname ? "true" : "false"}
      />
        </>
     
    )
}

export default InputFile;
